import React from "react";
import { Link } from "react-router-dom";
function menu_left() {
  return (
    <div id="layoutSidenav_nav">
      <li>
        <Link to="./">About</Link>
      </li>
      <li>
        <Link to="/Product">Product</Link>
      </li>
    </div>
  );
}

export default menu_left;
